"use strict";(self.webpackChunkeverybot_docs=self.webpackChunkeverybot_docs||[]).push([[6508],{66258:(e,t,o)=>{o.r(t),o.d(t,{assets:()=>s,contentTitle:()=>i,default:()=>d,frontMatter:()=>a,metadata:()=>h,toc:()=>l});var n=o(85893),r=o(11151);const a={sidebar_label:"Troubleshooting",sidebar_position:11,description:""},i="Everybot Troubleshooting",h={id:"manual/troubleshooting",title:"Everybot Troubleshooting",description:"",source:"@site/docs/manual/troubleshooting.md",sourceDirName:"manual",slug:"/manual/troubleshooting",permalink:"/2024-Everybot-Documentation/manual/troubleshooting",draft:!1,unlisted:!1,tags:[],version:"current",sidebarPosition:11,frontMatter:{sidebar_label:"Troubleshooting",sidebar_position:11,description:""},sidebar:"tutorialSidebar",previous:{title:"Completed Everybot Photos",permalink:"/2024-Everybot-Documentation/manual/photos"},next:{title:"FAQ",permalink:"/2024-Everybot-Documentation/manual/FAQ"}},s={},l=[{value:"Everybot does not climb high enough",id:"everybot-does-not-climb-high-enough",level:2},{value:"Everybot does not stay climbed",id:"everybot-does-not-stay-climbed",level:2},{value:"Everybot can not intake Notes into the launcher",id:"everybot-can-not-intake-notes-into-the-launcher",level:2},{value:"Everybot can not make shots into the Speaker",id:"everybot-can-not-make-shots-into-the-speaker",level:2},{value:"Can we use other motors/gearboxes/brackets/etcetera",id:"can-we-use-other-motorsgearboxesbracketsetcetera",level:2}];function c(e){const t={a:"a",h1:"h1",h2:"h2",p:"p",...(0,r.a)(),...e.components};return(0,n.jsxs)(n.Fragment,{children:[(0,n.jsx)(t.h1,{id:"everybot-troubleshooting",children:"Everybot Troubleshooting"}),"\n",(0,n.jsx)(t.h2,{id:"everybot-does-not-climb-high-enough",children:"Everybot does not climb high enough"}),"\n",(0,n.jsx)(t.p,{children:"If the Everybot climber does not lift the robot far enough off the ground, check that the PVC slider can easily make its way up and down the climber box tube and that the motor and gearbox are running and engaging correctly. If the back of the robot makes it off the ground but the front hangs down and remains touching the ground, add more weight to the rear ballast."}),"\n",(0,n.jsx)(t.h2,{id:"everybot-does-not-stay-climbed",children:"Everybot does not stay climbed"}),"\n",(0,n.jsx)(t.p,{children:"If the Everybot droops down on the chain and touches the floor within the period of time it would normally be hung up during endgame, a 1/2\u201d ratcheting wrench can be added to the shaft to hold the robot up. A ratchet with a reversible pawl so that it can be flipped around to the other direction so it can more easily be reset is preferred, otherwise the ratchet would need to be removed after every climb. Be careful to not drive the climber too far as it will bind up the ratchet. Some kind of catchment like bolts in the bearing support on the climber may be helpful in keeping the ratchet in place."}),"\n",(0,n.jsx)(t.h2,{id:"everybot-can-not-intake-notes-into-the-launcher",children:"Everybot can not intake Notes into the launcher"}),"\n",(0,n.jsxs)(t.p,{children:["If Notes are falling shallow off the intake chute for the launcher the height of the front of the launcher may need to be lowered down slightly. The bend in the end of the lower launcher plate can be increased up to the point that it causes the Note to drag on the top of the launcher chute, as too much of a bend will push the bottom plate upwards too far and cause shots to fall short. The ",(0,n.jsx)(t.a,{href:"https://firstfrc.blob.core.windows.net/frc2024/KitBot/KitBot%20Build%20Instructions.pdf",children:"FIRST KitBot Guide"})," includes a section at the bottom with troubleshooting steps that suggests adjusting the front mounting point where the upright supports meet the chassis."]}),"\n",(0,n.jsx)(t.h2,{id:"everybot-can-not-make-shots-into-the-speaker",children:"Everybot can not make shots into the Speaker"}),"\n",(0,n.jsx)(t.p,{children:"Make sure the launcher wheel is spun up to full speed before firing. Check that the Notes are not scraping against the launcher top panel and adjust the bend in the end of the bottom panel so there is less of a hump midway through the launcher chute. If you have a slow motion camera on a team member\u2019s cell phone, record a Note firing out of the launcher from above and see if it is brushing up against or bouncing off the roller claw or another portion of the robot. If the Notes are close to making it in, a slight adjustment of where the launcher mounts to the front of the chassis may also help. In our experience, both the KitBot and the Everybot shoot to the left rather than directly straight ahead."}),"\n",(0,n.jsx)(t.h2,{id:"can-we-use-other-motorsgearboxesbracketsetcetera",children:"Can we use other motors/gearboxes/brackets/etcetera"}),"\n",(0,n.jsx)(t.p,{children:"In general, yes! Ideally, the climbing gearbox is somewhere between approximately 50:1 to 75:1, but other configurations may work, they will just need to be tested first. A variety of different manufacturer\u2019s gearboxes can be used to run the climber. Any of the larger FRC\u2013legal motors (CIM, NEO, Falcon, MiniCIM, etc) can drive the climber as well as 775-class motors as long as you are careful to not stall the motor and burn it out. The Everybot roller claw plates can accept mounting for a 775Sport, Max Planetary (and any motor with a 2 inch bolt circle), or VersaPlanetary."}),"\n",(0,n.jsx)("br",{}),"\n",(0,n.jsxs)(t.p,{children:["If you are having additional problems with the Everybot or KitBot, please get in touch with the Everybot team in the ",(0,n.jsx)(t.a,{href:"https://discord.gg/b3GbxrFzkt",children:"Everybot Discord server"}),". This page will be updated with additional information as the season progresses."]})]})}function d(e={}){const{wrapper:t}={...(0,r.a)(),...e.components};return t?(0,n.jsx)(t,{...e,children:(0,n.jsx)(c,{...e})}):c(e)}}}]);